    <script>//GTM Gestione tracciamenti Form
        var eventoGtm = "form_newsletter";
        var params = {};
        params.lead_type = "form_newsletter";

        //GTM Gestione tracciamenti Check newsletter
        const marketingCheck = document.getElementById("marketingNewsletter");
        var eventoGtmNewsletter = "checkbox_newsletter";
        var paramsNewsletter = {}
        paramsNewsletter.lead_type = "checkbox_newsletter";
        paramsNewsletter.method = "checkbox";

        function pushEventToDataLayer(eventName, params = {}) {
            window.dataLayer = window.dataLayer || [];
            window.dataLayer.push({
                event: eventName,
                ...params
            });
        }


        var formNewsletter = document.getElementById("form-newsletter");

        formNewsletter.addEventListener("freeform-render-form-errors", function (event) {
            event.preventDefault();
        })
        formNewsletter.addEventListener("freeform-render-field-errors", function (event) {
            // Stop the default field error rendering
            event.preventDefault();
            const form = event.form;
            const errors = event.errors;
            for (var key in errors) {
                if (!errors.hasOwnProperty(key) || !key) {
                    continue;
                }
                var inputList = formNewsletter.querySelectorAll("*[name=" + key + "], *[name='" + key + "[]']");
                for (var inputIndex = 0; inputIndex < inputList.length; inputIndex++) {
                    var input = inputList[inputIndex];
                    input.parentElement.classList.add("error");
                    input.classList.remove("focus");
                }
            }
        });
        formNewsletter.addEventListener("freeform-render-success", function (event) {
            // Stop the default success message rendering
            event.preventDefault();
        });
        formNewsletter.addEventListener("freeform-on-submit", function (event) {
            formdatacontatti = new FormData(formNewsletter);
            var elems = formNewsletter.querySelectorAll(".error");
            Object.entries(elems).map((object) => {
                object[1].classList.remove("error");
            });
        });
        formNewsletter.addEventListener("freeform-ajax-success", function (event) {
            event.preventDefault();


            document.getElementById("successNewsletter").classList.add('open');
            pushEventToDataLayer(eventoGtm, params);
            if (marketingCheck.checked) {
                pushEventToDataLayer(eventoGtmNewsletter, paramsNewsletter);
            }
            console.log(dataLayer)
            setTimeout(function () {
                document.getElementById("successNewsletter").classList.remove('open');
                formNewsletter.reset();
            }, 4000);
        });</script>
